import { contact } from "../Contact";
function Card(props) {
    return (<div>
        <h1 className="heading">My Contacts</h1>
        <div className="card">
            <div className="top">
                <h2 >{props.name}</h2>
                <img
                    src={props.img}
                />
            </div>
            <div className="bottom">
            <p>{props.number}</p>
            <p>{props.email}</p>
            </div>
        </div>
    </div>
    )
}

export default Card;
